.button{
    display: inline-flex;
	align-items: center;
	justify-content: center;
	width: 100%;
	height: 80px;
	background: var(--primary-color);
	color: #fff;
	font-size: 20px;
	font-weight: 500;
	border: none;
	cursor: pointer;
	text-transform: uppercase;
	transition: .3s ease all;
	border-radius: 5px;
	position: relative;
	overflow: hidden;
}


.button span {
	position: relative;
	z-index: 2;
	transition: .3s ease all;
}

//Left hover button
.left_hover_button::after{
    content: "";
	width: 100%;
	position: absolute;
	z-index: 1;
	top: 0;
	left: calc(-100% - 80px);
	border-bottom: 80px solid var(--secondary-color);
	border-right: 80px solid transparent;
	transition: .4s ease-in-out all;
}

.left_hover_button:hover::after{
    left: 0;
}

//classic
.classic_hover_button:hover{
	background: var(--secondary-color);
	transition: .3s ease-in-out all;
}

//top
.top_hover_button::after {
	content: "";
	width: 100%;
	height: 100%;
	background: var(--secondary-color);
	position: absolute;
	z-index: 1;
	top: -80px;
	left: 0;
	transition: .3s ease-in-out all;
}

.top_hover_button:hover::after {
	top: 0;
}


//circle
.circle_hover_button::after {
	content: "";
	width: 100%;
	height: 350px;
	background: var(--secondary-color);
	position: absolute;
	z-index: 1;
	top: -350px;
	left: 0;
	right: 0;
	transition: .4s ease-in-out all;
	border-radius: 0px 0px 400px 400px;
}

.circle_hover_button:hover::after {
	top: 0;
}

// BUTTON DISABLED
*:disabled, 
*:disabled:hover{
	background: #666;
	color: #eee;
}

*:disabled::after,
*:disabled:hover:after{
	content: "";
	transition: none;
	width: 0;
	height: 0;
	border-bottom: 0;
	border-right: 0;
}

button:disabled{
	cursor: no-drop;
}

